    "reviewContent": "The introduction could use some work.  Maybe change the intro sentence to \"We collected data on the governorships across the US and economic statistics from 1948 to 2016.\"  Several portions of the rest of the paper should be polished to make reading it more fluid.  You misspelled \"governors\" as \"govenors\".  \"Each data point represents the performance of the economy at a given percentage of Republican governors.\" should read \"Each data point represents the percentage of Republican governors and the economic performance associated with that time.\"  \"After analyzing this data, we choose employment statistics to be our representation of overall economic performance.\" should say \"we chose\" rather than \"we choose\".  I would not call the conclusion valid.  Only 1 variable is analyzed, and the data shown does not show a particularly strong correlation, although that is the general trend.  There are several notable exceptions that should be looked at.  In addition, it would be useful to look at the relationships of non-normalized data.  I do like the visualization tool.",
