    "mode": 0,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "This is a study with interesting premises and speculations, but which ultimately falls short on being too wide in scope over such massive and ranging variables as those pertaining to national economies.  The idea is that with Republicans controlling governorships, the economy does better.  Sure, great speculation, but how do they contain the variable factors in the study?  There's no discussion of how to eliminate the factors of presidents, congresses (national and state), as well as myriad other factors.  Also, there is never a time when Republicans control all the governorships, or none.  It must be guesstimated based on majority percentage.  From the graph alone, one can see the wide range of economic responses to this statistical work-up. This unfortunately is an intellectually trifling attempt to give statistical legitimacy to what is ultimately an anecdotal speculation.",
