    "id": 48,
    "mode": 0,
    "identifiedError": true,
    "identifiedConclusion": false,
    "reviewContent": "There was insufficient information about the normalization procedure for the measures of economic performance; typically one would use a z-score to transform multiple measures into a single scale, but the authors' method is not clear.  More to the point, there was no need to normalize the measures because in the long run, the authors use only one of them (employment).  There was absolutely no rationale for selecting one of the five measures of economic performance and not reporting analyses of the others -- what would we conclude if the other's showed opposing relations to percent of Republican governors, or no relationship?  Selecting only one measure capitalizes on the likelihood of a false positive with multiple statistical tests. Additionally, I would encourage the authors' to include political party of the President, Senate and House majorities given that they analyze *national* economic performance rather than state-level performance.",
