    "identifiedConclusion": false,
    "reviewContent": "The paper suggests essentially that Republican governors are better for the economy of the country overall.  They come to the conclusion by analyzing different metrics of the economy, particularly employment statistics from the periods of 1948-2016.  They use other statistics as well, such as GDP, but the main metric they draw their conclusion from is employment statistics. Essentially, they take the overall number of Republican governors in the country and represent it as a percentage (i.e. if 25 states have Republican governors it would be represented as .5 or 50% in their statistics), and then use overall employment numbers as a reference.  So if employment numbers are good in a particular year, and there are a majority of Republican governors, that would suggest the Republican governors are the reason for the success.  However, I presume the researchers are using national employment statistics, and not state-by-state statistics.  It is possible to think that a Democratic governor's positive employment numbers could be swallowed up by a poor national economy (or a Republican's for that matter).  Furthermore national economy policy has an absolutely huge effect on the performance of states, which this method basically can't take into account (i.e. think about NAFTA).  Finally, what about state legislatures?  Governors have limited control on a state economy.  I personally am a Republican and am intrigued by the findings, but further research is needed to determine the effects of national employment policies, as well as the effect state legislatures have on employment numbers.",
