    "reviewContent": "The conclusion and topic is interesting, but is very far-reaching and bites off too much at once. For instance, how do we know these are the factors that make an economy robust? Many times, the building of a bubble is actually a bad thing for the economy in the long run, but these metrics would suggest those who build paper gains help the econcomy (stocks and inflation, in particular). The study should pick any one of these metrics and go into a deep dive rather than lumping them all together and calling it \"the economy\". Additionally, is employment a good thing in and of itself? I would say not. Gainful employment would be a more interesting metric and would need to be defined. Also, it seems the \"boost\" in economy above would not be evenly distributed; wealthy individuals tend to benefit from stocks and inflation more than middle and lower classes.",
