    "reviewContent": "I don't know that its validate to conclude anything but the existence of the measure correlation itself.   It seems that the study assumes past results predict the future.   Is there any science on which we can base this conclusion?  Why was 1948 the starting point for the data analysis?   Does the conclusion that Republican governors provide better economic growth hold from 1918 to 1948?    In other words have you demonstrated that your conclusion is confirmed against a different historical period?   How many democratic governors presided over periods of comparable growth?  How many Republican governors failed to produce the positive results.   What was the distribution of data across states and underlying industries.  Did agricultural states fair the same as industrial states?   ",
